description:
KC and the Sunshine Band - Part 3 is the fourth studio album by the funk and disco group KC and the Sunshine Band. The album was produced by Harry Wayne Casey and Richard Finch and was released in October 1976 on the TK label.

1. &quot;Baby I Love You (Yes, I Do)&quot;
2. &quot;Wrap Your Arms Around Me&quot;
3. &quot;I Like to Do It&quot;
4. &quot;(Shake, Shake, Shake) Shake Your Booty&quot;	
5. &quot;Let's Go Party&quot;
6. &quot;Come on In&quot;
7. &quot;I'm Your Boogie Man&quot;
8. &quot;Keep It Comin' Love&quot;
